import React from 'react';

export default function AdminDashboard() {
  return (
    <div style={{ margin: '20px' }}>
      <h2>Admin Dashboard</h2>
      <ul>
        <li>Manage Users</li>
        <li>View All Gigs</li>
        <li>Manage Reports</li>
        {/* Add admin-specific options */}
      </ul>
    </div>
  );
}
